const App = () =>{

    const img = "https://picsum.photos/200/300";
    const title = "Card title";
    const links = "http://www.lushfashionhub.com";
    const linkCon = "Go somewhere";
    const altcon = "images";


    return(
        <>
        <h1 className="text-center m-5 text-danger">Hello All!</h1>
        <div className="container">
        <div className="row">
            <div className="col">
            <div className="card">
            <img src={img} className="card-img-top" alt="..." height="200px"/>
            <div className="card-body">
                <h5 className="card-title">{title}</h5>
                <p className="card-text">Some quick example text to build on the card title 
                and make up the bulk of the card's content.</p>
                <a href={links} class="btn btn-primary">{linkCon}</a>
            </div>
            </div>
            </div>
        </div>
        </div>
       

   </>     
 );    
};
export default App;
